// CountIDs returns the count of ids with FGA batch filtering applied
func (gq *GroupQuery) CountIDs(ctx context.Context) (int, error) {
	logx.FromContext(ctx).Debug().Str("query_type", "Group").Str("operation", "count_ids").Msg("CountIDs: starting")

	ctx = setContextOp(ctx, gq.ctx, ent.OpQueryIDs)

	ids, err := gq.IDs(ctx)
	if err != nil {
		logx.FromContext(ctx).Error().Err(err).Str("query_type", "Group").Str("operation", "count_ids").Msg("CountIDs: IDs() failed")

		return 0, err
	}

	logx.FromContext(ctx).Debug().Str("query_type", "Group").Str("operation", "count_ids").Int("count", len(ids)).Msg("CountIDs: completed")

	return len(ids), nil
}

// GroupGroupBy is the group-by builder for Group entities.
type GroupGroupBy struct {
	selector
	build *GroupQuery
}

// Aggregate adds the given aggregation functions to the group-by query.
func (_g *GroupGroupBy) Aggregate(fns ...AggregateFunc) *GroupGroupBy {
	_g.fns = append(_g.fns, fns...)
	return _g
}

// Scan applies the selector query and scans the result into the given value.
func (_g *GroupGroupBy) Scan(ctx context.Context, v any) error {
	ctx = setContextOp(ctx, _g.build.ctx, ent.OpQueryGroupBy)
	if err := _g.build.prepareQuery(ctx); err != nil {
		return err
	}
	return scanWithInterceptors[*GroupQuery, *GroupGroupBy](ctx, _g.build, _g, _g.build.inters, v)
}

func (_g *GroupGroupBy) sqlScan(ctx context.Context, root *GroupQuery, v any) error {
	selector := root.sqlQuery(ctx).Select()
	aggregation := make([]string, 0, len(_g.fns))
	for _, fn := range _g.fns {
		aggregation = append(aggregation, fn(selector))
	}
	if len(selector.SelectedColumns()) == 0 {
		columns := make([]string, 0, len(*_g.flds)+len(_g.fns))
		for _, f := range *_g.flds {
			columns = append(columns, selector.C(f))
		}
		columns = append(columns, aggregation...)
		selector.Select(columns...)
	}
	selector.GroupBy(selector.Columns(*_g.flds...)...)
	if err := selector.Err(); err != nil {
		return err
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := _g.build.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

// GroupSelect is the builder for selecting fields of Group entities.
